[s]Description[/s][hr]A small description here about your dappervolk character.[/td][td][s]Abilities[/s][hr][b]Scatter[/b] butter cubes over flour and mix briefly with a fork or spatula to coat the butter with flour.

[b]Cut[/b] the butter into the flour with a pastry blender, working mixture until the flour has a coarse, mealy texture similar to fresh bread crumbs. About 1  2 minutes.

[b]Work[/b] butter and flour with the pastry blender until flour is evenly distributed. About 20 seconds. (Dough should look crumbly with pea-sized pieces).

[b]Sprinkle[/b] ice water over the mixture  start with 4 tablespoons and add from there. Using a rubber spatula, press the dough into itself. The crumbs should begin to form larger clusters. If you pinch some of the dough and it holds together, its ready. If the dough falls apart, add 2 to 4 more tablespoons of water and continue to press until dough comes together.[/td][/tr][/table][/left][url=https://dappervolk.com/forum/topic/748][img]https://i.imgur.com/rXV5fSn.png[/img][/url]


CSS - - - - -

/* Stat Block Profile by Aly1293 */
div + div + a { height: 0; display: block; float: right; overflow: visible; margin: -2.5rem 1.25rem 0 0; }
div + div + a img { width: 2rem; height: 2rem; opacity: .5; max-width: 2rem; }

/* Adjust styles */
table, tr, td, th { background: none; vertical-align: top; }

/* Background */
div + div { letter-spacing: 0.025rem; font-family: Georgia; margin: -1.25rem; padding: 1.25rem 2.5rem 2.5rem 2.5rem; background-position: center;
background-image: url('https://image.freepik.com/free-photo/paperboard-yellow-texture_95678-83.jpg'); }

/* Main Heading */
p { font-size: 2.5rem; }

/* Sub Title */
strike { text-transform: lowercase; color: #89584c; font-weight: bold; text-decoration: none; display: block; font-size: 1.5rem; font-style: italic; font-weight: 300; }

/* Divider */
hr { outline: none; border: 0; margin: 0 0 0.5rem 0; padding: 0; display: block; width: 100%; height: 0.2rem; background: #764137; }

/* Avatar Image */
div + div img { width: 50%; }
